    <section className="introduction">
      <p className="emphasised">Hi, I'm Elisabeth</p>
      <h1><span>Frontend</span> <span>Developer</span></h1>
      <div className="">
        <Link className="nav-link" to="/contact"><StyledBlockCta>Contact</StyledBlockCta></Link>
        <a href='/vicente_elisabeth-cv-2024.pdf' target="_blank">Download resume</a>
      </div>
